import React, { Component } from 'react';
import Product from './Product';
import Title from './Title';

export default class ProductList extends Component {
    state={
        products: []
    }
    render() {
        return (
            <React.Fragment>
                <div className="container">
                    <div className="row">
                        <Title title="Products"></Title>
                    </div>
                </div>
            </React.Fragment>
        )
    }
}
